      pathname: "/OrderDetails",
      state: item,
    });
  };

  return (
    <div>
      <div style={{ textAlign: "center", fontWeight: "bold", fontSize: 18 }}>
        <label>Package Details</label>
      </div>
      <table style={{ width: "100%" }}>
        <tr>
          <th>Serial Number</th>
          <th>Sender Name</th>
          <th>Arraived date</th>
          <th>View details </th>
        </tr>
        {listData1 !== undefined && listData1.length > 0
          ? listData1.map((item, index) => (
              <tr>
                <td>{index}</td>
                <td>{item.sender}</td>
                <td>{moment(item.last_updated).format("MM/DD/YYYY")}</td>
